import { useSelector } from "react-redux";
import "./VehicleList.css";

const DUMMY_VEHICLE = [
  {
    id: 1,
    type: "CAR/JEEP/VAN",
    number: "TN24AQ4644",
    date: "09/09/2022, 16:43:48",
    toll: "Chengalpattu",
    tariff: 60,
  },
  {
    id: 2,
    type: "CAR/JEEP/VAN",
    number: "TN24AQ4644",
    date: "09/09/2022, 16:43:48",
    toll: "Chengalpattu",
    tariff: 60,
  },
  {
    id: 3,
    type: "CAR/JEEP/VAN",
    number: "TN24AQ4644",
    date: "09/09/2022, 16:43:48",
    toll: "Chengalpattu",
    tariff: 60,
  },
];

export default function VehicleList() {
  const form = useSelector((state) => state.vehicle);
  console.log(form);
  return (
    <>
      <div className="row vehicle-list-bar">
        <div className="col-lg-4">VEHICLE TYPE</div>
        <div className="col-lg-2">VEHICLE NUMBER</div>
        <div className="col-lg-2">DATE/TIME</div>
        <div className="col-lg-2">TOLL NAME</div>
        <div className="col-lg-2">TARIFF</div>
      </div>
      {DUMMY_VEHICLE.map((item) => {
        return (
          <div className="row vehicle-list" key={item.id}>
            <div className="col-lg-4">{item.type}</div>
            <div className="col-lg-2">{item.number}</div>
            <div className="col-lg-2">{item.date}</div>
            <div className="col-lg-2">{item.toll}</div>
            <div className="col-lg-2">{item.tariff}</div>
          </div>
        );
      })}
    </>
  );
}
